import React, { Fragment } from "react";

import "./NavigationBar.css";

const NavigationBar = () => {
  return (
    <Fragment>
      <nav className="navigation-bar">
        <img className="logo" src="logo.png" />

        <a href="#">Home</a>
        <a href="#">Projects</a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Get in Touch</a>
      </nav>
    </Fragment>
  );
};

export default NavigationBar;
